import * as React from 'react';
import IconButton from '@mui/material/IconButton';
import { Tooltip } from '@material-ui/core';
import HelpIcon from '@mui/icons-material/Help';

export default function CustomTooltip() {


  
  return (
    <div class = "MuiTooltip" style={{ margin: '100px' }}>
      <style>
        {`
        .custom-tooltip {
          padding: 0;
          background-color: transparent;
        }

        .custom-arrow {
          display: none;
        }
        `}
      </style>
      <Tooltip classes={{ tooltip: 'custom-tooltip', arrow: 'custom-arrow' }} title="A really good explanation of Rate and Throughput">
        <IconButton>
          <HelpIcon />
        </IconButton>
      </Tooltip>
    </div>
  );
}
